import React from "react";
// import {Navbar,Form,FormControl ,Nav} from "react-bootstrap";
// import {Navbar,Nav,Carousel} from "react-bootstrap";
import {Carousel} from "react-bootstrap";
// import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
// import { faGoogle} from "@fortawesome/free-brands-svg-icons";
// import { library } from '@fortawesome/fontawesome-svg-core'
import './FNavbar.css';
function FNavbar() {
  // library.add(faGoogle ); 
    return (
  

   <div className="FNavbar" >
      {/* <div className="FNavbar">
      <Navbar className="Navbar" variant="" style={{backgroundColor:""}}>
      <Navbar.Brand href="#home"><img src="logo.png" alt="Facebooklogo"/></Navbar.Brand>
      <Nav className="mr-auto" style={{Color:"#800e16" ,textAlign:"center"}}>
      <Nav.Link href="#updates">updates</Nav.Link>
        <Nav.Link href="#favorite">favorite</Nav.Link>
        <Nav.Link href="#Menu">Menu</Nav.Link>
        <Nav.Link href="#About us">About us</Nav.Link>
        <Nav.Link href="#Contact">Contact</Nav.Link>
       </Nav>
       </Navbar>
       </div> */}
   <Carousel>
      <Carousel.Item interval={1000}>
        <img
          className="d-block w-100"
          src="slid1.png"
          alt="First slide"
        />
      </Carousel.Item>
      <Carousel.Item interval={500}>
        <img
          className="d-block w-100"
          src="slid2.png"
          alt="Third slide"
        />
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src="slid3.png"
          alt="Third slide"
        />
      </Carousel.Item>
      </Carousel>
 <div>
  <br />
  <br />
  <br />
  <footer classname="logo">
  <img src="logo.png" alt="logo"/>
  <br />
    <h6 style={{}}>Desing by Hweda Bargo </h6>
  </footer>
  <br />
</div>

  
</div>

  );
}

export default FNavbar;
